import React, {useState} from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';
import "./styles.css"
import Button from 'react-bootstrap/Button';



export default function App() {

  const [number, setNumber] = useState('');

  return (
    <SearchNumContaner>
      <Form.Label   value={number} >Введите номер</Form.Label>
      <div className='containerSearch'>
          <Form.Control type="text" id="inputPassword5" aria-describedby="passwordHelpBlock" />
          <Button variant="success">Поиск</Button>
      </div>
      <Form.Text id="passwordHelpBlock" className = "passwordHelp">
        Номер дожен соответсвовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
}
